import React from 'react';

const Card = ({ title, description, date }) => {
  return (
    <div className="card">
      <h3 className="card-title">{title}</h3>
      <p className="card-description">{description}</p>
      <p className="card-date">{date}</p>
    </div>
  );
};

export default Card;
